import { GoogleAPI } from './PropublicaCandidateAPI';

export function LandingPage() {
    return(
        <div>
            <Title />
            <AddressInput />
            <GoogleAPI />
        </div>
    );
}

function Title() {
    return(
        <h1>FundsToVotes</h1>
    )
}

function AddressInput() {
    const [address, setAddress] = useState();


    return(
        <div>
            <form>
            <label>
                Address:
                <input type="text" address="address" onChange={e => setAddress(e.value)}/>
            </label>
            <input type="submit" value="submit" onSubmit={onSubmit(address)}/>
        </form>
        <GoogleAPI />
        </div>
    )
}

function onSubmit(address) {
    return(
        <GoogleAPI address={address}/>
    );
}
